import styles from './Header.module.css'

const Header = (props) => {
    return (
    <>
        <header className={styles.header}>
            <h1>React Meals</h1>
            <Button>Cart</Button>
        </header>
        <div classNAme={styles['main-image']}>
            <img src={mealsImage} alt='A table full of delicious food!'/>
        </div>
    </>
    )
}

export default Header;
